window.bookSummaryJSON = "<p>This fast-paced collection of novellas and short stories from leading Russian LitRPG authors sheds new light on their signature worlds. <i>You're in Game!</i> features works by Vasily Mahanenko, Andrei Livadny, Alexey Osadchuk, Michael Atamanov, Pavel Kornev, and Andrew Novak. Expect your favorite heroes to play second fiddle to an array of new main characters, once-minor plot lines to lead you in unexpected directions, and familiar story events to take surprising new turns. </p>"; 
